//new strings ડૉ. ખાતે માં કલાકો આગામી (0) પૂર્ણ (0) રદ કરેલ (0) શરૂ થાય છે પ્રાપ્ત કૃપા કરીને મૂલ્ય દાખલ કરો મહત્તમ દસ્તાવેજનું કદ 512 KB છે દસ્તાવેજો પસંદ કરો વાંચો મોકલ્યું ત્યારથી બાકી છે એક કેસ દીઠ તમે મહત્તમ 5 છબીઓ મોકલી શકો છો તમે એક કેસ દીઠ વધુમાં વધુ 2 છબીઓ મોકલી શકો છો પસંદ કરો પસંદ કરો કેમેરાની પરવાનગી નકારાઈ! ગેલેરી ડેટા પસંદ કરવામાં અસમર્થ! મહત્તમ દસ્તાવેજનું કદ 1 MB છે ઇન્ટેલહેલ્થ કેવી રીતે કામ કરે છે? Intelehealth એ એક વ્યાપક ટેકનોલોજી પ્લેટફોર્મ વિકસાવ્યું છે જેનો ઉપયોગ સરકારો, NGO અને હોસ્પિટલો તેમના લાભાર્થીઓને ટેલીમેડિસિન-આધારિત સંભાળ પહોંચાડવા માટે કરી શકે છે. 80+ કેર પ્રોટોકોલ સાથે ડિજિટલ સહાયક જેવી શક્તિશાળી સુવિધાઓ સાથે બનેલ કોઈપણ સંસ્થા માટે તેમની જરૂરિયાતોને પહોંચી વળવા માટે તેનો ઉપયોગ અને અનુકૂલન કરવાનું સરળ બનાવે છે! Intelehealth શા માટે અસ્તિત્વમાં છે? ઇન્ટેલેહેલ્થની ટીમ પાસે \"બધા માટે સ્વાસ્થ્ય\" નું વિઝન છે. આમ, સાર્વત્રિક આરોગ્ય કવરેજના આ વિઝનને જીવંત રાખવા માટે Intelehealth અસ્તિત્વમાં છે. તે હાંસલ કરવા માટે પ્રયત્ન કરે છે કે આ વિશ્વમાં દરેક નાગરિક કોઈપણ આર્થિક મુશ્કેલીનો સામનો કર્યા વિના, તેમને જ્યારે અને ક્યાં જરૂર હોય તે સ્વાસ્થ્ય સેવાઓ પ્રાપ્ત કરવા સક્ષમ બને. ઇન્ટેલહેલ્થ દર્દીઓને કેવી રીતે મદદ કરે છે? અમારી ટેલિમેડિસિન એપ પ્રાથમિક આરોગ્યસંભાળમાં આવતા ગ્રામીણ વસ્તી માટે નિષ્ણાત ડૉક્ટર પરામર્શ ઉપલબ્ધ કરાવે છે. એપ્લિકેશનનો ઉપયોગ કરીને, HWs દર્દીની દવાઓના ઇતિહાસ, નિદાન, પ્રિસ્ક્રિપ્શન્સ અને સારવારની વિગતો મેળવવામાં સક્ષમ છે. આ બધી વિગતો અમે પછી દૂરના ડોકટરો સાથે પરામર્શ આપવા માટે શેર કરી. તે દર્દીઓને આરોગ્ય સંભાળ માટે દૂર મુસાફરી કરવાથી બચાવવામાં મદદ કરે છે. નવા દર્દીની નોંધણી કેવી રીતે કરવી? દર્દીની નોંધણી કરવા માટે, હોમ સ્ક્રી પર "દર્દી ઉમેરો" ટેબ પર ક્લિક કરો. દર્દીને ગોપનીયતા નીતિ વાંચો. જો તેઓ સ્વીકારે છે, તો દર્દીની સફળતાપૂર્વક નોંધણી કરવા માટે તમામ વિગતો ભરો. નવી મુલાકાત કેવી રીતે ઉમેરવી? એકવાર દર્દી નોંધાયેલ છે, દર્દીની વિગતો સ્ક્રીન પર, દર્દી માટે નવી મુલાકાત બનાવવા માટે "મુલાકાત શરૂ કરો" બટનને ક્લિક કરો. એપોઇન્ટમેન્ટ કેવી રીતે બુક કરવી? એકવાર દર્દી નોંધાય છે અને મુલાકાત બનાવવામાં આવે છે, મુલાકાત સારાંશ સ્ક્રીન પર, "એપોઇન્ટમેન્ટ" બટનને ક્લિક કરો. તારીખ અને સમય (ઉપલબ્ધ સ્લોટમાંથી) પસંદ કરો જે દર્દીને અનુકૂળ હોય. નિષ્ણાત ડૉક્ટર સાથે એપોઇન્ટમેન્ટ બુક કરાવવા માટે "બુક એપોઇન્ટમેન્ટ" પર ક્લિક કરો. રૂપરેખા ફાઇલ ખૂટે છે. ફોલોઅપ કરો ઓટીપી મોકલવામાં નિષ્ફળ otp ખોટો છે! OTP ચકાસણી નિષ્ફળ! ઘરે હળવા તાવની સારવાર કરો એનિમિયા શું છે? ઘરે ઉધરસની સારવાર કરો ચાલવાના ફાયદા ની બહાર બાકી એપ્લિકેશનમાંથી બહાર નીકળો છેલ્લું સમન્વયન મદદ કેન્દ્ર મદદ પસંદ કરેલ તારીખ આજનું દર્દીની નોંધણી બંધ કરીએ? શું તમે ખરેખર દર્દીની નોંધણી બંધ કરવા માંગો છો? આરોગ્ય તાલીમ એપ્લિકેશન વિશે શું તમે ખરેખર ભાષાને %1$s માં બદલવા માંગો છો? ભાષા બદલો? ભાષા સફળતાપૂર્વક બદલાઈ ગઈ! પ્રોટોકોલ બદલતા પ્રોટોકોલ બદલાઈ રહ્યા હોય ત્યાં સુધી કૃપા કરીને રાહ જુઓ. પ્રોટોકોલ સફળતાપૂર્વક બદલવામાં આવ્યા છે! એકંદરે દૈનિક તારીખ શ્રેણી મુલાકાત તારીખ દર્દી નોંધાયેલ છે! શું દર્દી હવે મુલાકાત શરૂ કરવા માંગે છે? કોઈ સરનામું ઉમેર્યું નથી કોઈ દેશ ઉમેરાયો નથી કોઈ રાજ્ય ઉમેર્યું નથી કોઈ જિલ્લો ઉમેરાયો નથી કોઈ શહેર ઉમેર્યું નથી કોઈ શહેર ઉમેર્યું નથી કોઈ ફોન નંબર ઉમેર્યો નથી ફોલો અપ શેડ્યૂલ! આ દર્દીની મુલાકાત માટેનું ફોલોઅપ સફળતાપૂર્વક સુનિશ્ચિત કરવામાં આવ્યું છે. આના પર ડાઉનલોડ કરેલ: ડૉક્ટરે %1$s પર ફોલો-અપ મુલાકાતનું સૂચન કર્યું સફળતાપૂર્વક ડાઉનલોડ કર્યું પ્રિસ્ક્રિપ્શન અદ્યતન છે. બધા જવાબો પસંદ કરો માઇન્ડમેપ્સ સાથે કેટલીક સમસ્યા. ના પ્રશ્નો %1$d/%2$d મુલાકાતનું કારણ કૃપા કરીને શ્રેણી પસંદ કરો! સ્તર %1$d કૃપા કરીને પસંદ કરવા માટે ખેંચો! હા અથવા ના પસંદ કરો સમયગાળો પ્રકાર પસંદ કરો કૃપા કરીને તારીખ પસંદ કરો કૃપા કરીને ઓછામાં ઓછો એક વિકલ્પ પસંદ કરો! પાસવર્ડ બદલવામાં નિષ્ફળ વિશેષતા શૂન્ય ન હોવી જોઈએ કૃપા કરીને સમય સ્લોટ પસંદ કરો બુકિંગ એપોઇન્ટમેન્ટ! માટે પરિણામો નિમણૂક! આજે ખાતે સાથે મુલાકાત લીધી છે %1$d/%2$d શારીરિક તપાસ %1$d/%2$d તબીબી ઇતિહાસ: કૌટુંબિક ઇતિહાસ દ્વારા છબી ઉમેરો કૃપા કરીને ની ફોલો-અપ મુલાકાત લો. હેલો આ ટેલિમેડિસિન પ્રોજેક્ટમાંથી %1$s છે. તમારી તાજેતરની મુલાકાત અંગે હું તમારી સાથે જોડાઈ રહ્યો છું. કૃપા કરીને ડૉક્ટરના સંદેશની રાહ જુઓ! ડૉક્ટરે હજુ સુધી દર્દીઓ માટે પ્રિસ્ક્રિપ્શન મોકલવાનું બાકી છે. તમે ડૉક્ટરને યાદ કરાવી શકો છો. કૃપા કરીને ઓછામાં ઓછી એક ફરિ